import React from 'react';
import styled from 'styled-components';

const TestimonialsContainer = styled.div`
  padding: 2rem;
  text-align: center;
  background: #6D71D0;
  color: white;
`;

const Title = styled.h2`
  font-size: 2rem;
  margin-bottom: 1rem;
`;

const Testimonial = styled.div`
  margin: 1rem 0;
  font-size: 1.2rem;
  line-height: 1.6;
  max-width: 800px;
  margin: 0 auto;
`;

const TestimonialsSection = () => {
  return (
    <TestimonialsContainer>
      <Title>What Our Users Say</Title>
      <Testimonial>
        "This app has completely transformed the way I work and exercise. The real-time feedback is invaluable!" - Jane Doe
      </Testimonial>
      <Testimonial>
        "I love how easy it is to use and the insights it provides. Highly recommend!" - John Smith
      </Testimonial>
    </TestimonialsContainer>
  );
};

export default TestimonialsSection;
